import './Home.scss';


var google = document.getElementById("google");

google.scrollIntoView({
  behavior: "smooth",
  block: "start",
  inline: "nearest"
});

var facebook = document.getElementById("facebook");

facebook.scrollIntoView({
  behavior: "smooth",
  block: "start",
  inline: "nearest"
});


function Home() {
  return (
    <div className="home">

      <div className="title" id="title">words here</div>
      <button onclick="document.getElementById('title').scrollIntoView()">
        Back to the top
      </button>
    </div>
  )
}

export default Home;
